import React, { useState } from 'react';
import { Card, Row, Col, Statistic, Button, message, Upload } from 'antd';
import {
  ExperimentOutlined, FileTextOutlined, SettingOutlined,
  ApiOutlined, UploadOutlined,
} from '@ant-design/icons';
import type { UploadRequestOption } from 'antd/lib/upload/interface';   // v4 路径
import type { UploadFile } from 'antd';                                 // ⭐ 新增
import axios from 'axios';

// ========================= 首页 =========================
const Home: React.FC = () => {
  const [backendMessage, setBackendMessage] = useState('未连接');
  const [tagFileName, setTagFileName] = useState('未上传');     // 当前活跃文件名
  const [uploading, setUploading] = useState(false);           // Upload 按钮 loading

  /* ---------- 1. 测试后端连通 ---------- */
  const testBackendConnection = async () => {
    try {
      const { data } = await axios.get('/api/test');
      setBackendMessage(data.message);
      message.success('后端连接成功！');
    } catch {
      setBackendMessage('连接失败');
      message.error('后端连接失败，请检查服务是否启动');
    }
  };

  /* ---------- 2. 自定义上传 Tag.json ---------- */
  const customUpload = async (option: UploadRequestOption) => {
    const { file, onSuccess, onError } = option;
    setUploading(true);
    try {
      const fd = new FormData();
      fd.append('file', file as Blob, (file as any).name);

      const { data } = await axios.post('/api/upload-tag-json', fd, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });

      message.success(`${file.name} 上传成功并设为当前训练文件`);
      setTagFileName(data.filename);
      onSuccess && onSuccess(data, {} as any);
    } catch (err: any) {
      message.error(`上传失败：${err?.response?.data?.detail || err.message}`);
      onError && onError(err);
    } finally {
      setUploading(false);
    }
  };

  /* ---------- 3. Upload 组件配置 ---------- */
  const uploadProps = {
    accept: '.json',
    maxCount: 1,
    customRequest: customUpload,
    onRemove: () => {
      setTagFileName('未上传');
      return true;
    },
    fileList: tagFileName !== '未上传'
      ? [{
          uid: '1',
          name: tagFileName,
          status: 'done' as UploadFile['status'], // ⭐ 类型断言
        }]
      : [],
  };

  /* ---------------- JSX ---------------- */
  return (
    <div>
      <h1>参数拟合工具</h1>

      {/* 统计面板 */}
      <Row gutter={16}>
        <Col span={8}>
          <Card><Statistic title="已训练参数" value={0} prefix={<ExperimentOutlined />} /></Card>
        </Col>
        <Col span={8}>
          <Card><Statistic title="数据集数量" value={0} prefix={<FileTextOutlined />} /></Card>
        </Col>
        <Col span={8}>
          <Card><Statistic title="配置项" value={0} prefix={<SettingOutlined />} /></Card>
        </Col>
      </Row>

      {/* 测试后端按钮 */}
      <div style={{ marginTop: 32, textAlign: 'center' }}>
        <Button type="primary" icon={<ApiOutlined />} onClick={testBackendConnection}>
          测试后端连接
        </Button>
        <p style={{ marginTop: 12 }}>后端状态：{backendMessage}</p>
      </div>

      {/* 上传 Tag.json */}
      <div style={{ marginTop: 48, textAlign: 'center' }}>
        <h2>训练参数文件管理</h2>
        <Upload {...uploadProps}>
          <Button icon={<UploadOutlined />} loading={uploading} disabled={uploading || tagFileName !== '未上传'}>
            上传 Tag.json
          </Button>
        </Upload>
        <p style={{ marginTop: 12 }}>当前活跃文件：{tagFileName}</p>
      </div>
    </div>
  );
};

export default Home;
